import * as React from "react";
import { createRoot } from "react-dom/client";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";

import App from './App'

const router = createBrowserRouter([
  {
    path: "*",
    element: <APP />,

    path: "/",
    element: (
      <App />
    ),
  },
  {
    path: "/diary",
    element: <h1>About</h1>,
  },
]);

createRoot(document.getElementById("root")).render(
  <RouterProvider router={router} />
);
